import React, {useEffect} from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedAthlete, onLogSubmit, workouts, onLogDelete } ) {

    const workoutsToDisplay = workouts.map((workout) => <WorkoutCard onLogSubmit={onLogSubmit} key={workout.id} workout={workout} selectedAthlete={selectedAthlete} onLogDelete={onLogDelete}/>)

    const filterWorkoutByDate = workoutsToDisplay.sort((a, b) => a.date.localeCompare(b.date) )

    return (
        <div id="workout_list">
            {filterWorkoutByDate}
            {/* {selectedAthlete === "All" ? workoutsToDisplay(workouts) : workoutsToDisplay(selectedAthlete.workouts)} */}
        </div>
    )
}

export default WorkoutList
